import os
import urllib.request
import math

url_download_autodockvina = "http://vina.scripps.edu/download/autodock_vina_1_1_2_linux_x86.tgz"

def download_autodock_vina(url, file_path, file_name):
    full_path = file_path+ file_name+'.tgz'
    urllib.request.urlretrieve(url, full_path)
def download_pdb(url, file_path, file_name):
    full_path = file_path+ file_name+'.pdb'
    urllib.request.urlretrieve(url, full_path)

# Download Autodock Vina
print("Downloading Autodock Vina and setting everything up... :D")
download_autodock_vina(url_download_autodockvina, './', "AutodockVinaZip")
print("Done.")

#Decompress
