def download_subsets(subsets):
    print("")
    list_subsets = subsets.split(" ")
    error_string = "These subsets have not been downloaded successfully:"
    count = 0
    for i in range(len(list_subsets)):
        nsubset = list_subsets[i]
        try:
            urllib.request.urlretrieve("http://files.docking.org/3D/"+nsubset[0]+nsubset[1]+"/"+nsubset[2]+nsubset[3]+nsubset[4]+nsubset[5]+"/"+nsubset+".xaa.pdbqt.gz", "Ligands/"+nsubset+".xaa.pdbqt.gz")
            count += 1
        except Exception as e:
            error_string += " "+nsubset
    print(str(count)+" of "+str(len(list_subsets))+" subsets have been successfully downloaded.")
    if error_string != "These subsets have not been downloaded successfully:":
        print(error_string)

