def split_pdbqt(file):
    f = open(file, "r")
    if f.mode == 'r':
        contents = f.read()
    for i in range(len(contents)):
        aux = False
        if contents[i] == "M":
            if contents[i+1] == "O":
                if contents[i+2] == "D":
                    if contents[i+3] == "E":
                        if contents[i+4] == "L":
                            aux = True
        if aux:
            zinc_text = ""
            zinc_name = ""
            s=i+1
            while contents[s] != "\n":
                s+=1
            t=s+1
            while 1:
                if contents[t] == "=":
                    s=t+2
                    while contents[s] != "\n":
                        zinc_name += contents[s]
                        s+=1
                if contents[t] == "E":
                    if contents[t+1] == "N":
                        if contents[t+2] == "D":
                            if contents[t+3] == "M":
                                if contents[t+4] == "D":
                                    if contents[t+5] == "L":
                                        break
                zinc_text += contents[t]
                t+=1
            if zinc_name != "":
                q = open("Ligands/{}.pdbqt".format(zinc_name),"w+")
            else:
                q = open("error_name{}.pdbqt".format(i),"w+")
            q.write(zinc_text)

